import React from "react";

import "./Admin.css";
import Sidebar from "./SideBar";
import SidebarButton from "./SideBarButton";

const Admin = () => {
	return (
		<div id="admin-page">
			<Sidebar id="side-bar">
				<button>Menu</button>
				<button>Bill</button>
				<SidebarButton>Manage</SidebarButton>
			</Sidebar>
		</div>
	);
};

export default Admin;
